const ExpenseList = props => {
    let expenseContent = <p className="no_expenses_found">No Expenses found.</p>

    if (props.items.length > 0) {
        expenseContent = props.items.map((expense) => (
          <ExpenseItem
            key={expense.id}
            title={expense.title}
            amount={expense.amount}
            date={expense.date}
          />
        ))
      }

